import React from 'react';
import Nav from "./components/Nav/index";
import { Container, Row, Col } from "./components/Grid";
import Search from "./components/Search";

function App() {
  return (
    <div>
      <h1 className="text-center"><b>SpeakEasy</b></h1>
      <Search />
      <Row>
        <Container>
          <h3>hello world</h3>
        </Container>
      </Row>


    </div>
  );
}

export default App;
